window.bookSummaryJSON = "<p>Alex's life was fairly simple, work during the day and enjoy some sweet RPG's by night. Out of nowhere, he's whisked away to a fantasy world with game-like stats, monsters that drop loot, gorgeous mages, and a Dungeon to explore.</p> <p>With only the clothes on his back and a single skill bestowed upon him, he has to survive this new world and forge a new life for himself.</p> <p>And perhaps work on getting a harem while he’s at it.</p> <p><b>Authors note:</b> Inspired by light novels, RPG's and mangas. Contains Isekai, light LitRPG/ Gamelit stats, dungeons, magic, and a touch of tropes.</p>"; 
